import React, { FC } from 'react';
import { PcaWrapper } from './pca.styled';
import Pagination from 'react-bootstrap/Pagination';

interface CarProps {
   car: {
      comments: string[];
      digits: string;
      is_stolen: boolean;
      model: string;
      model_year: number;
      operations: Array<any>;
      photo_url: string;
      region: {
        name: string;
        name_ua: string;
        slug: string;
        old_code: string;
        new_code: string;
      };
      stolen_details: any;
      vendor: string;
      vin: string;
    } | null | string;
}

const Pca: FC<CarProps> = ({car}) => {

   let active = 2;
   let items = [];
   for (let number = 1; number <= 5; number++) {
   items.push(
      <Pagination.Item key={number} active={number === active}>
         {number}
      </Pagination.Item>,
   );
   }

   return(
   <PcaWrapper>
      <div>
         <Pagination>{items}</Pagination>
         <br />


      </div>
   </PcaWrapper>)

   };

export default Pca;
